<b><i>INFO:</i></b>&#13;
&#13;
In a short period of time, Protoxic have built a respectable name in the international club scene as DJs, producers and remixers.&#13;
&#13;
The French based duo have knocked out some solid tracks out of their studio and managed some high profile releases and remixes on reputable labels such as Universal/Mercury, Pacha Rec, Roton / Ultra and the list goes on. Support came quickly from some of the worlds most prominent DJ’s including but not limited to: Fedde Le Grand, Gareth Emery, Marco V, Luciano, Abel Ramos, Ferry Corsten, David Jones, Ahmet Sendil, Jerry Ropero, Spartaque ..&#13;
&#13;
Alongside their own production work, Protoxic also run their own Protoxic Records imprint on which they release a wide range of quality music from around the world.We can be sure to expect big things from their label in the future.&#13;
&#13;
As their ambitions are big, Protoxic are truly a talent to keep a watchful eye on !&#13;
&#13;
This is the story so far, and there is definitely more to come ...&#13;
